%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%
% 	1.Sphere Function
%   sphere function
%   min @ x = [0, 0 .....,0], minf = 0, range = [-100,100]
function [f, varargout]=f1(in,flag)
xtar=0;     ytar=0;      ftar=0;
in_2 = (in).^2;
f=sum(in_2,2);
varargout{1}=xtar;
varargout{2}=ytar;
varargout{3}=ftar;

% 2. Zakharov Function
% min @ x = [0, 0, ..., 0], minf = 0, range = [-5, 10]
function [f, varargout] = f2(in, flag)
    xtar = 0; ytar = NaN; ftar = 0;
    indices = (1:size(in, 2));  % Generates a row vector of indices
    sum1 = sum(in.^2, 2);
    sum2 = sum(0.5 * indices .* in, 2);  % Ensure sum is applied row-wise with .* for element-wise multiplication
    f = sum1 + sum2.^2 + sum2.^4;
    varargout{1} = xtar;
    varargout{2} = ytar;
    varargout{3} = ftar;

% 3. Sum Squares Function
% min @ x = [0, 0, ..., 0], minf = 0, range = [-10, 10]
function [f, varargout] = f3(in, flag)
    xtar = 0; ytar = NaN; ftar = 0;
    indices = (1:size(in, 2));
    f = sum((indices .* (in.^2)), 2);  % Each element is multiplied by its index
    varargout{1} = xtar;
    varargout{2} = ytar;
    varargout{3} = ftar;

% 4. Schwefel's problem 2.22 
% min @ x = [0, 0 .....,0], minf = 0, range = [-10,10]
function [f, varargout]=f4(in,flag)
xtar=0;     ytar=0;      ftar=0;
f=sum(abs(in),2)+prod(abs(in),2);
varargout{1}=xtar;
varargout{2}=ytar;
varargout{3}=ftar;

% 5. Schwefel's Problem 2.26 
% note: known minimum @ all x = 420.9687; minf = -418.9829*D
function [f, varargout]=f5(in,flag)
D=size(in,2);    
xtar=420.9687; ytar=420.9687; ftar=-418.9829*D;
in_abs = abs(in);
in_s = sqrt(in_abs);
sin_in = sin(in_s);
f = -sum((in.*sin_in), 2);
varargout{1}=xtar;
varargout{2}=ytar;
varargout{3}=ftar;
 
% 6. Rosenbrock
%  note: known minimum =0 @ all x = 1
function [f, varargout]=f6(in,flag)
 xtar=1;     ytar=1;      ftar=0;
 x0=in(:,1:end-1);
 x1=in(:,2:end);
 f = sum( (100*(x1-x0.^2).^2 + (x0-1).^2) , 2);
 varargout{1}=xtar;
 varargout{2}=ytar;
 varargout{3}=ftar;

% 7. Ackley.m
% note: known minimum @ all x = 0; minf = 0
function [f, varargout]=f7(in,flag)
% dimension is # of columns of input, x1, x2, ..., xn
xtar=0; ytar=0; ftar=0; 
n=length(in(1,:));
x=in;
 e=exp(1);
 f = (-20*exp(-0.2*sqrt((1/n).*sum(x.^2,2)))+20 + e ...
       -exp((1/n).*sum(cos(2*pi*x),2)));
varargout{1}=xtar;
varargout{2}=ytar;
varargout{3}=ftar;
 
%  8. Rastrigin function
% note: known minimum =0 @ all x = 0
function [f, varargout]=f8(in,flag)
xtar=0; ytar=0; ftar=0; 
cos_in = cos(2*pi*in);
f    = sum((in.^2-10*cos_in + 10), 2);
varargout{1}=xtar;
varargout{2}=ytar;
varargout{3}=ftar;
 
% 9. Griewank Function
function [f, varargout]=f9(in,flag)
xtar=0; ytar=0; ftar=0;
x=in; ff=1;
D=size(in,2);
for i=1:D
    ff=ff.*cos(x(:,i)./sqrt(i));
end
f=sum(x.^2,2)./4000-ff+1;
varargout{1}=xtar;
varargout{2}=ytar;
varargout{3}=ftar;


% 10. Bent Cigar Function
% min @ x = [0, 0, ..., 0], minf = 0, range = [-100, 100]
function [f, varargout] = f10(in, flag)
    xtar = 0; ytar = NaN; ftar = 0;
    f = in(:, 1).^2 + 1e6 * sum(in(:, 2:end).^2, 2);
    varargout{1} = xtar;
    varargout{2} = ytar;
    varargout{3} = ftar;

