% Brown Function
% min @ x = [0, 0, ..., 0], minf = 0, range = [-1, 4]
function [f, varargout] = brown(in, flag)
    xtar = 0; ytar = NaN; ftar = 0;
    f = sum((in(:, 1:end-1).^2).^(in(:, 2:end).^2 + 1) + (in(:, 2:end).^2).^(in(:, 1:end-1).^2 + 1), 2);
    varargout{1} = xtar;
    varargout{2} = ytar;
    varargout{3} = ftar;

    % Dixon-Price Function
% min @ x = [2^(-(2^i-2)/2^i)], minf = 0, range = [-10, 10]
function [f, varargout] = dixon_price(in, flag)
    xtar = 2.^(-(2. * (1:size(in, 2)) - 2) ./ (2.^(1:size(in, 2))));
    ytar = NaN; ftar = 0;
    f = (in(:, 1) - 1).^2 + sum((2:size(in, 2))' .* (2 * in(:, 2:end).^2 - in(:, 1:end-1)).^2, 2);
    varargout{1} = xtar;
    varargout{2} = ytar;
    varargout{3} = ftar;


% Schwefel's problem 1.2
% min @ x = [0, 0 .....,0], minf = 0, range = [-100,100]
function [f, varargout]=schw2(in,flag)
[rw cl]=size(in);
 xtar=0;     ytar=0;      ftar=0;
for i=1:rw
    for j=1:cl
    if j~=1; in(i,j)=in(i,j)+in(i,j-1); end
    end
end
in_2=in.^2;  
f=sum(in_2,2);
varargout{1}=xtar;
varargout{2}=ytar;
varargout{3}=ftar;


